	return (
		<div class="App">
			<Router className="overallbg">
				<Route exact path="/" component={MainPage} />
				<Route path="/create" component={Create} />
				<Route path="/explore" component={Explore} />
				{/*Dont touch this div or anything beyond here */}
			</Router>
		</div>
	);
}

